import React from 'react';

const floatingStyle = {
  position: 'fixed',
  left: '50%',
  bottom: '40px',
  transform: 'translateX(-50%)',
  background: 'rgba(30, 41, 59, 0.95)',
  color: '#fff',
  padding: '16px 28px',
  borderRadius: '24px',
  fontSize: '1.15rem',
  fontWeight: 500,
  boxShadow: '0 4px 24px rgba(0,0,0,0.18)',
  zIndex: 9999,
  maxWidth: '90vw',
  textAlign: 'center',
  letterSpacing: '0.01em',
  display: 'flex',
  alignItems: 'center',
  gap: '10px',
  pointerEvents: 'none',
  animation: 'fadeInUp 0.5s',
};

const AICommentFloating = ({ aiFeedback }) => {
  if (!aiFeedback) return null;
  return (
    <div style={floatingStyle}>
      <span role="img" aria-label="ai">ðŸ¤–</span>
      <span>{aiFeedback}</span>
    </div>
  );
};

export default AICommentFloating;
